import { View, Text, Image } from 'react-native'

export default function ProfilPicture({}) {
    return(
        <Image source={{ uri : 'https://upload.wikimedia.org/wikipedia/commons/thumb/f/fa/Wiki_training_0226.jpg/207px-Wiki_training_0226.jpg'}}/>
    )
}
